            <tspan style="white-space:pre" y="14.4" x="9">如果文件是一个符号链接时,返回该符号链接相关信息,而不是这个符号链接引用的文件的信息</tspan>
        </text>
    </g>
    <g ed:width="55" ed:height="21" transform="matrix(1,0,0,1,548.69,1311.47)" ed:parentid="221" id="235">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">fstatat</tspan>
        </text>
    </g>
    <g ed:width="271" ed:height="21" transform="matrix(1,0,0,1,630.69,1311.47)" ed:parentid="235" id="237">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">相对于当前打开目录的路径名返回文件统计信息</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,478.69,1460.72)" ed:parentid="218" id="239">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">文件类型</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,572.69,1369.72)" ed:parentid="239" id="241">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">普通文件</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,572.69,1427.97)" ed:parentid="239" id="243">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">目录文件</tspan>
        </text>
    </g>
    <g ed:width="79" ed:height="21" transform="matrix(1,0,0,1,572.69,1455.47)" ed:parentid="239" id="245">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">块特殊文件</tspan>
        </text>
    </g>
    <g ed:width="91" ed:height="21" transform="matrix(1,0,0,1,572.69,1491.47)" ed:parentid="239" id="247">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">字符特殊文件</tspan>
        </text>
    </g>
    <g ed:width="45" ed:height="21" transform="matrix(1,0,0,1,572.69,1527.47)" ed:parentid="239" id="249">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">FIFO</tspan>
        </text>
    </g>
    <g ed:width="55" ed:height="21" transform="matrix(1,0,0,1,572.69,1554.97)" ed:parentid="239" id="251">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">套接字</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,572.69,1582.47)" ed:parentid="239" id="253">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">符号链接</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,666.69,1338.97)" ed:parentid="241" id="255">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">数据类型有文本和二进制数据,对于UNIX内核而言没有区别,对普通文件内容解释由处理该文件</tspan>
            <tspan style="white-space:pre" y="31.4" x="9">的应用程序进行</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,666.69,1383.47)" ed:parentid="241" id="257">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">例外: 如果是二进制可执行文件,为了执行,内核必须理解其格式,所有二进制可执行文件都遵循一</tspan>
            <tspan style="white-space:pre" y="31.4" x="9">种标准化格式</tspan>
        </text>
    </g>
    <g ed:width="454" ed:height="21" transform="matrix(1,0,0,1,666.69,1427.97)" ed:parentid="243" id="259">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">任何一个具有读权限的进程都可以读取目录内容,但是只有内核可以直接写目录文件</tspan>
        </text>
    </g>
    <g ed:width="354" ed:height="21" transform="matrix(1,0,0,1,678.69,1455.47)" ed:parentid="245" id="261">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">提供对设备(磁盘)带缓冲的访问,每次访问以固定长度为单位进行</tspan>
        </text>
    </g>
    <g ed:width="515" ed:height="38" transform="matrix(1,0,0,1,690.69,1482.97)" ed:parentid="247" id="263">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">提供对设备不带缓冲的访问,每次访问长度可变, 系统中所有设备要么是块特殊文件要么是字符</tspan>
            <tspan style="white-space:pre" y="31.4" x="9">特殊文件</tspan>
        </text>
    </g>
    <g ed:width="190" ed:height="21" transform="matrix(1,0,0,1,644.69,1527.47)" ed:parentid="249" id="265">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">用于进程间通信,也成为命名管道</tspan>
        </text>
    </g>
    <g ed:width="139" ed:height="21" transform="matrix(1,0,0,1,654.69,1554.97)" ed:parentid="251" id="267">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">用于进程间的网络通信</tspan>
        </text>
    </g>
    <g ed:width="103" ed:height="21" transform="matrix(1,0,0,1,666.69,1582.47)" ed:parentid="253" id="269">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">指向另一个文件</tspan>
        </text>
    </g>
    <g ed:width="91" ed:height="21" transform="matrix(1,0,0,1,478.69,1609.97)" ed:parentid="218" id="271">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">文件访问权限</tspan>
        </text>
    </g>
    <g ed:width="67" ed:height="21" transform="matrix(1,0,0,1,478.69,1670.4)" ed:parentid="218" id="273">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">文件截断</tspan>
        </text>
    </g>
    <g ed:width="43" ed:height="21" transform="matrix(1,0,0,1,572.69,1670.4)" ed:parentid="273" id="275">
        <text class="st46">
            <tspan style="white-space:pre" y="14.4" x="9">图片</tspan>
        </text>
    </g>
